import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import {NavigationContainer, DefaultTheme} from '@react-navigation/native';
import { Theme } from '@react-navigation/native/lib/typescript/src/types';
import { Linking } from 'expo';

import NavigatorStack from '@Navigator/navigator';

export default function App() {
  const NavigationContainerProps: Theme = {
    dark: true,
    colors: {
      ...DefaultTheme.colors,
      primary: "#0e1113"
    }
  }

  const prefix = Linking.makeUrl('/');
  const linkingConfig = {
    enabled: true,
    prefixes: ["https://railscope.iocu.be", prefix],
    config: {
      app: {
        path: ""
      },
      Home: {
        path: ""
      },
      About: {
        path: "about"
      },
      StationServices: {
        path: "station-services/:crs",
      },
      ServiceInfo: {
        path: "service-info/:rid/:userStationCrs?",
      },
      SearchStations: "search",
      BookmarkedStations: {
        path: ""
      },
      TrackedServices: {
        path: ""
      },
      TrackedServiceOptions: {
        path: ""
      },
      ConfirmSettingsReset: {
        path: ""
      },
      ServiceAdditionalInfo: {
        path: "additional-info/:rid/:origin/:destination/:userStationCrs"
      }
    }
  }

  return (
    <View style={styles.container}>
      <NavigationContainer theme={NavigationContainerProps} linking={linkingConfig}>
        <NavigatorStack />
      </NavigationContainer>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    // backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
